   "source": [
    "Let's explore the effect of different choices of k, from 1 to 9, on this clustering.\n",
    "1. Cluster the data 9 times, each using a different value of k\n",
    "2. Create columns containing the tidied, glanced and augmented data"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 10,
   "metadata": {
    "execution": {
     "iopub.execute_input": "2022-07-13T15:14:18.274779Z",
     "iopub.status.busy": "2022-07-13T15:14:18.272797Z",
     "iopub.status.idle": "2022-07-13T15:14:18.473868Z",
     "shell.execute_reply": "2022-07-13T15:14:18.472400Z"
    },
    "papermill": {
     "duration": 0.240991,
     "end_time": "2022-07-13T15:14:18.474006",
     "exception": false,
     "start_time": "2022-07-13T15:14:18.233015",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "k_clusts <- tibble(k = 1:9) %>%\n",
    "  mutate(\n",
    "    kclust = map(k, ~kmeans(food_meat, .x)),\n",
    "    tidied = map(kclust, tidy),\n",
    "    glanced = map(kclust, glance),\n",
    "    augmented = map(kclust, augment, food)\n",
    "  )"
   ]
  },
