    "    recipe(~., data=.)%>%\n",
    "    step_center(all_numeric()) %>%\n",
    "    step_scale(all_numeric()) %>%\n",
    "    step_pca(all_numeric(), num_comp = 3) %>%\n",
    "    prep(retain=TRUE)\n",
    "pca_trans$template"
   ]
